// Core
import React, { Suspense, useEffect, useState } from 'react';
import { BrowserRouter } from 'react-router-dom';

// Plugin
import { CircularProgress, Grid } from '@mui/material';
import OneSignal from 'react-onesignal';
// Custom
import { ENV_CONFIG } from './constant';
import { loginWithOuth } from './sevices/account';
import { getCurrentUserData, isEmptyObj, isExpiredRefreshToken, setCurrentUser } from './utils/genericUtilities';
import RouteComponent from './routes';

import 'react-big-calendar/lib/css/react-big-calendar.css';
// App Global Style
import './App.scss';
import ScrollToTop from './routes/scrollToTop';
import { HelmetProvider } from 'react-helmet-async';
import HomePage from './pages/home';
function App() {
  const [authenticated, setAuthenticated] = useState(false);



  const helmetContext = {};
  return (
    <BrowserRouter>
      <HelmetProvider context={helmetContext}>
        <ScrollToTop>
          <Suspense
            fallback={
              <Grid item md={12} height={"90vh"} display={'flex'} justifyContent="center" alignItems={"center"}>
                <CircularProgress />
              </Grid>
            }
          >
            {/* <RouteComponent authenticated={authenticated} /> */}
            <HomePage />
          </Suspense>
        </ScrollToTop>
      </HelmetProvider>
    </BrowserRouter>
  );
}

export default App;
